commits.content:
.footer {
	display: flex;
	align-items: center;
	justify-content: space-between;
	padding: 20px;
	background-color: white;
}

.icon {
	display: flex;
	align-items: center;
	gap: 10px;
}

.header {
	display: flex;
	align-items: center;
	justify-content: space-between;
	padding: 20px;
	/* background: linear-gradient(to right, rgb(255, 251, 251), #6b7280, 0.1); */
}

.nav {
	display: flex;
	align-items: center;
	gap: 20px;
}

.link {
	font: 500 16px "Roboto", sans-serif;
	color: #111827;
}

.active {
	color: #2563eb;
	font: 700 16px "Roboto", sans-serif;
}
